var i=0;window.addEventListener('DOMContentLoaded',()=>{const TL=document.querySelector("#twittertimeline");const doWhenIntersect=entries=>{if(String(!entries[0].isIntersecting)){i+=1;if(i===2){var script=document.createElement("script");script.src="https://platform.twitter.com/widgets.js";document.head.appendChild(script);}}}
const observer=new IntersectionObserver(doWhenIntersect,{});observer.observe(TL);});